css:
.nuclide-ui-code-snippet {
  display: flex;
}
.nuclide-ui-code-snippet atom-text-editor[mini] {
  border-top-left-radius: 0;
  border-bottom-left-radius: 0;
  flex: 1;
  font-size: 12px;
  line-height: 25px;
  max-height: none;
}
.nuclide-ui-code-snippet atom-text-editor .highlight.code-snippet-highlight .region {
  background-color: #e5e5e6;
}
.nuclide-ui-code-snippet-line-number-column {
  background: #dbdbdc;
  border-top-left-radius: 3px;
  border-bottom-left-radius: 3px;
  font-family: Menlo, Monaco, Consolas, monospace;
  padding: 0 0.5em;
}
.nuclide-ui-code-snippet-line-number {
  color: #050505;
  line-height: 25px;
}
